  `remark` varchar(64) DEFAULT NULL COMMENT '备注',
  `remark_check` varchar(64) DEFAULT NULL COMMENT '审批备注',
  `special_switch` char(1) DEFAULT NULL COMMENT '专项预算开关。1-是、0-否',
  `subject_id` int(11) DEFAULT NULL COMMENT '科目表主键',
  `subject_name` varchar(16) DEFAULT NULL COMMENT '科目名称',
