  `bank_name` varchar(64) DEFAULT NULL COMMENT '收款银行',
  `account` varchar(64) DEFAULT NULL COMMENT '收款账号',
  `tax_num` varchar(32) DEFAULT NULL COMMENT '税号',
  `user_account` varchar(64) DEFAULT NULL COMMENT '收款账号',
  `belong` char(50) DEFAULT NULL COMMENT '费用归属。1-本部门、0-法人行机关',
