  `begin_place_1` varchar(16) DEFAULT NULL COMMENT '起点1',
  `end_date_1` datetime DEFAULT NULL COMMENT '到达日期1',
  `end_place_1` varchar(16) DEFAULT NULL COMMENT '终点1',
  `begin_date_2` datetime DEFAULT NULL COMMENT '出发日期2',
  `begin_place_2` varchar(16) DEFAULT NULL COMMENT '起点2',
  `end_date_2` datetime DEFAULT NULL COMMENT '到达日期2',
  `end_place_2` varchar(16) DEFAULT NULL COMMENT '终点2',
  `ticket_num_railway` int(11) DEFAULT NULL COMMENT '火车票张数',
  `ticket_amount_railway` int(11) DEFAULT NULL COMMENT '火车票金额',
  `ticket_num_air` int(11) DEFAULT NULL COMMENT '机票张数',
  `ticket_amount_air` int(11) DEFAULT NULL COMMENT '机票金额',
  `ticket_num_taxi` int(11) DEFAULT NULL COMMENT '出租车票张数',
  `ticket_amount_taxi` int(11) DEFAULT NULL COMMENT '出租车票金额',
  `ticket_num_steamer` int(11) DEFAULT NULL COMMENT '船票张数',
  `ticket_amount_steamer` int(11) DEFAULT NULL COMMENT '船票金额',
  `people_num` int(11) DEFAULT NULL COMMENT '出差人数',
  `day_num` int(11) DEFAULT NULL COMMENT '出差天数',
